description:
Fluid Mask 3 is designed for photographers, image editors, graphic designers and all those who take digital image editing seriously. 
In a streamlined interface and workflow, Fluid Mask 3 instantly shows key edges in the image and provides comprehensive easy to use tools that work with difficult-to-see edges and tricky areas like trees &amp; lattices. 
